import { VuiFlexContainer, VuiFlexItem, VuiTitle, VuiSpacer } from "../../ui";
import "./categoryQuestions.scss";

// Define reference types with FCS rankings
interface Reference {
  id: string;
  title: string;
  description: string;
  fcsScore: number;
  riskLevel: 'Low Risk' | 'Medium Risk' | 'High Risk';
}

